import React from 'react';
import DeleteForeverIcon from '@mui/icons-material/DeleteForever';
import { Trashicon } from '../styled/TrashIcon';

export default function DeleteToDo({onDelete, todos}) {

  const handleDeleteClick = () => {
    console.log("Trashicon clicked");
    onDelete(); // onDelete funtion wird aufgerufen um das ToDo zu löschen. Delete selber passiert als Inline Function in createAppContainer.jsx
    localStorage.setItem("todosCount", JSON.stringify(todos.length - 1)); //Count -1 nach löschen
  }

  return (
    <Trashicon className="trashicon" onClick={handleDeleteClick}>
        <DeleteForeverIcon/>
    </Trashicon>
  );
}
